function search(thisfrm){
	var k = thisfrm.k.value;
	if (k == "")
	{
		return false;
	}
	k = k.toLowerCase().replace(/ /g, "-");

	window.location = "https://www.clipartmax.com/so/"+k+"/";
	return false;
}

